script:
reset();

const size = 96;
const maxTerrainHeight = 8;
const maxHeight = 80;
const origin = { x: size * -0.5, z: size * -0.5 };
// const seed = Math.floor(Math.random() * (2 ** 32));
// console.log(`seed: ${seed}`);
const seed = 897580047;
const simplex = new SimplexNoise(seed);

const well = {
  origin: {
    x: -1,
    y: 0,
    z: -1,
  },
  radius: 24,
  height: 69,
};
const tower = {
  origin: {
    x: -8,
    y: 0,
    z: -8,
  },
  size: {
    x: 16,
    y: 16,
    z: 16,
  },
};

const map = new Uint8Array(size * maxHeight * size);

const trunk = 3;
const leaves = 2;
const voxelNeighbors = [
  { x: 1, y: 0, z: 0 },
  { x: -1, y: 0, z: 0 },
  { x: 0, y: 0, z: 1 },
  { x: 0, y: 0, z: -1 },
  { x: 0, y: 1, z: 0 },
  { x: 0, y: -1, z: 0 },
];
const tree = (
  position,
  height,
  radius
) => {
  const branches = height + radius * 0.5;
  const queue = [position];
  while (queue.length) {
    const {
      x,
      y,
      z,
      distance = 0,
    } = queue.shift();
    if (y < 0 || y >= maxHeight) {
      return;
    }
    const isTrunk = distance < height;
    update(origin.x + x, y, origin.z + z, (isTrunk || distance < branches) ? trunk : leaves);
    const pushNeighbor = (offset) => {
      const nx = x + offset.x;
      const ny = y + offset.y;
      const nz = z + offset.z;
      if (
        nx >= 0 && nx < size
        && nz >= 0 && nz < size
        && !map[nx * size * maxHeight + ny * size + nz]
      ) {
        queue.push({
          x: nx,
          y: ny,
          z: nz,
          distance: distance + 1,
        });
        return true;
      }
      return false;
    };
    if (isTrunk) {
      pushNeighbor({ x: 0, y: 1, z: 0 });
    } else if (distance === height) {
      voxelNeighbors.forEach((offset) => {
        if (offset.y !== -1) {
          pushNeighbor(offset);
        }
      });
    } else if (distance < (height + radius)) {
      let count = 0;
      const neighbors = voxelNeighbors.length;
      for (let i = 0; i < neighbors; i += 1) {
        const neighbor = voxelNeighbors[
          Math.floor(
            Math.abs(simplex.noise3D((x + i) * 2, (y - i) / 2, (z + i) * 2)) * neighbors
          )
        ];
        if (pushNeighbor(neighbor)) {
          count += 1;
          if (count >= 2) {
            break;
          }
        }
      }
    }
  }
};

const terrainY = 60;
const center = size * 0.5 - 0.5;
for (let x = 0; x < size; x += 1) {
  for (let y = 0; y < maxTerrainHeight + 10; y += 1) {
    for (let z = 0; z < size; z += 1) {
      const sd = (center - x) ** 2 + (center - z) ** 2;
      const top = Math.min(size * Math.exp(
        -(sd) / ((size - 16) * 12)
      ), size * 0.5 - Math.sqrt(sd));
      const height = 10 + Math.floor(
       (
          Math.abs(simplex.noise3D(x / 32, y / 24, z / 32)) * 0.3
          +  Math.abs(simplex.noise3D(x / 64, y / 48, z / 64)) * 0.3
          +  Math.abs(simplex.noise3D(x / 128, y / 64, z / 128)) * 0.4
        ) * top
      );
      map[x * size * maxHeight + (terrainY - 10 + y) * size + z] = y < height;
    }
  }
}

for (let x = 0; x < size; x += 1) {
  for (let y = 0; y < maxHeight; y += 1) {
    for (let z = 0; z < size; z += 1) {
      if (y < terrainY - 10) {
        update(origin.x + x, y, origin.z + z, 8);
        continue;
      }
      if (map[x * size * maxHeight + y * size + z]) {
        const top = (
          (
            Math.sqrt(
              ((origin.x + x) - well.origin.x - 0.5) ** 2
              + ((origin.z + z) - well.origin.z - 0.5) ** 2
			) > well.radius
          ) && (
            y === (maxHeight - 1)
            || !map[
              x * size * maxHeight + (y + 1) * size + z
            ]
          )
        );
        const type = top ? 1 : 4;
        if (top && y > 2 && simplex.noise3D(x / 8, y / 4, z / 8) > 0.6) {
          if (simplex.noise3D(y / 8, x / 4, z / 8) > -0.5) {
            update(origin.x + x, y + 1, origin.z + z, 5);
          } else {
            const n = Math.abs(simplex.noise2D(z / 8, x / 8));
            const h = 5 + Math.floor(Math.abs(simplex.noise2D(x / 2, z / 2)) * 8);
            const r = 7 + Math.floor(n * h * 0.5);
            tree({x, y, z}, h, r);
          }
        }
        update(origin.x + x, y, origin.z + z, type);
      }
    }
  }
}

// Well
cylinder(
  well.origin.x, well.origin.y, well.origin.z,
  'y', well.radius + 2, well.height, (x, y, z) => (
  	Math.sqrt(
      (x - well.origin.x - 0.5) ** 2
      + (z - well.origin.z - 0.5) ** 2
    ) > well.radius - 2 ? 6 : 0
  )
);
for (let y = 0; y < well.height; y += 6) {
  cylinder(
    well.origin.x, well.origin.y + y, well.origin.z,
    'y', well.radius, 3, 0
  );
}

// Rocket tower
box(
  tower.origin.x, tower.origin.y, tower.origin.z,
  tower.size.x, tower.size.y,tower. size.z,
  6
);
box(
  tower.origin.x + tower.size.x * 0.5 - 6,
  tower.origin.y + tower.size.y - 1,
  tower.origin.z + tower.size.z * 0.5 - 6,
  12, 1, 12,
  0
);

const branches = 8;
const steps = 11;
const slice = Math.PI * 2 / branches;
for (let i = 0; i < branches; i += 1) {
  let angle = slice * i;
  let dist = 9;
  let y = tower.origin.y + tower.size.y - 2;
  for (let j = 0; j < steps; j += 1) {
    update(
      tower.origin.x + tower.size.x * 0.5 + 0.5 + Math.floor(Math.cos(angle) * dist),
      y,
      tower.origin.z + tower.size.z * 0.5 + 0.5 + Math.floor(Math.sin(angle) * dist),
      7
    );
    angle -= Math.PI * 0.1 / 3;
    dist += 1;
    y += 1;
  }
}

// Lava
cylinder(
  well.origin.x, well.origin.y, well.origin.z,
  'y', well.radius, 1, 9
);

const elevators = [
  {
    x: 26,
    y: 68,
    z: -4,
    r: 0
  },
  {
    x: -34,
    y: 68,
    z: -4,
    r: 1
  }
];
elevators.forEach(({ x, y, z, r }) => {
  box(
    x, y - 6, z,
    8, 13, 8,
    6
  );
  box(
    x + 1, y - 1, z + 1,
    6, 7, 6,
    8
  );
  box(
    x + 2, y, z + 2,
    4, 5, 4,
    0
  );
  box(
    x + (r === 0 ? -1 : 8), y, z + 2,
    1, 5, 4,
    7
  );
  box(
    x + (r === 0 ? -1 : 6), y, z + 3,
    3, 4, 2,
    0
  );
  box(
    x + (r === 0 ? -2 : 9), y, z + 1,
    1, 4, 6,
    0
  );
});
